import { css } from 'styled-components'

const link = css`
  font-family: 'Inter';
  font-weight: 500;
  font-size: 12px;
  line-height: 25px;
  letter-spacing: 0.2p;x
`

const h1 = css`
  font-family: 'Inter', sans-serif;
  font-weight: 600;
  font-size: 28px;
  line-height: 34px;
`

const h2 = css`
  font-family: 'Inter', sans-serif;
  font-weight: 600;
  font-size: 24px;
  line-height: 29px;
`

const button = css`
  font-family: 'Inter', sans-serif;
  font-weight: 500;
  font-size: 14px;
  letter-spacing: 0.2px;
`

const input = css`
  font-family: 'Inter', sans-serif;
  font-weight: 600;
  font-size: 14px;
  line-height: 15px;
  letter-spacing: 0.21px;
`

const label1 = css`
  font-family: 'Inter', sans-serif;
  font-weight: 600;
  font-size: 13px;
  line-height: 16px;
  letter-spacing: 0.2px;
`

const body1 = css`
  font-family: 'Inter', sans-serif;
  font-weight: 400;
  font-size: 14px;
  line-height: 18px;
  letter-spacing: 0.2px;
`

const pollLetters = css`
  font-family: 'Inter', sans-serif;
  font-weight: 600;
  font-size: 14px;
  line-height: 16px;
  letter-spacing: 0.2px;
`

export default {
  link,
  h1,
  h2,
  button,
  input,
  label1,
  body1,
  pollLetters,
}
